import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import InfoSection from './components/InfoSection';
import MainPoster from './components/MainPoster';
import EventButtons from './components/EventButtons';
import Footer from './components/Footer';
import EventDetail from './components/EventDetail'; // Create this component for event details
import './styles.css';

const App = () => {
  return (
    <Router>
      <Navbar />
      <main>
        <Switch>
          {/* Route for the home page */}
          <Route exact path="/">
            <InfoSection />
            <MainPoster />
            <EventButtons />
          </Route>

          {/* Routes for event detail pages */}
          <Route path="/event1" component={EventDetail} />
          <Route path="/event2" component={EventDetail} />
          <Route path="/event3" component={EventDetail} />
          <Route path="/event4" component={EventDetail} />
          <Route path="/event5" component={EventDetail} />
        </Switch>
      </main>
      <Footer />
    </Router>
  );
};

export default App;
